import React from "react";

const DabiVoutcher = () => {
  return (
    <div className="bg-informationBackground">
      <div className="mx-auto max-w-3xl bg-white">
        <div className="flex  p-3  justify-items-center items-center ">
        
        <div>
        <h3 className="text-lg text-left">দাবি ভাউচার</h3>
          <h3> Apply Vouche</h3>
          <input
            type="text"
            inputMode="numeric"
            pattern="[0-9]*"
            placeholder="Enter Voucher Code"
            className="border px-4 py-2 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
          <button>
            জমা দিন
            </button>
        </div>
        
           
        
        </div>
      </div>
    </div>
  );
};

export default DabiVoutcher;
